import React from 'react';
import './app.css';
import { Switch, Route } from 'react-router-dom';
import {CardPage, MainPage} from "../pages";
import Header from "../header";

const App = () => {
  return (
    <div className='app'>
      <Header/>
      <Switch>
        <Route path='/' exact>
          <MainPage />
        </Route>
        <Route path='/card'>
          <CardPage />
        </Route>
        <Route path='*'>
          <h1>This page is not found</h1>
        </Route>
      </Switch>
  </div>
  )
}

export default (App);
